import React, { useState, useEffect } from 'react';
import '../styles/Home.css';
import { Helmet } from 'react-helmet';

const Home = () => {
  const [features, setFeatures] = useState([]);

  useEffect(() => {
    const fetchFeatures = setTimeout(() => {
      setFeatures([
        { id: 1, title: 'Responsive Design', description: 'Our designs work on any device.', img: 'responsive_design.jpg' },
        { id: 2, title: 'Fast Performance', description: 'We optimize our code for speed.', img: 'fast_performance.jpg' },
        { id: 3, title: 'Secure', description: 'Security is a priority for us.', img: 'secure.jpg' },
        // Add more features as needed
      ]);
    }, 2000);

    return () => clearTimeout(fetchFeatures);
  }, []);

  return (
    <div className="home-container">
      <Helmet>
        <title>Welcome | Techbitz.io - Crafting Digital Success</title>
        <meta name="description" content="Welcome to Techbitz.io, the home of digital solutions designed to transform your business. Explore our wide range of services and see how we can help you succeed online." />
      </Helmet>
      <div className="home-title">
        <h2>Welcome to Techbitz.io</h2>
      </div>
      <div className="home-content">
        <p>We offer an extensive suite of digital services designed to transform your online business. Check out some of our key features:</p>
      </div>
      <div className="features-list">
        {features.map(feature => (
          <div key={feature.id} className="feature-card">
            <img src={`/images/${feature.img}`} alt={feature.title} />
            <h3>{feature.title}</h3>
            <p>{feature.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home;
